import json
MASTER = -1
class Test():
    def __init__(self):
        self.flat_company_data = {}
        self.raw_company_list =  self.reduce_attributes(response= self.retutn_api_data())
        self.master_company_uuid= '5e0dccba-41ff-48ad-9ef1-1a8e85b8c194'
        self.__build_flat_hash()
        file_path = "output.json"
        with open(file_path, 'w') as json_file:
            json.dump(self.flat_company_data, json_file, indent=4)        
        
        
    def __build_flat_hash(self):
        for record in self.raw_company_list:
            record = self.__transform_record(record=record)
            print(record)
            self.flat_company_data[record['id']] = record
            # self.flat_company_data_by_name[record['name'].lower()] = record
            
    def __transform_record(self, record) -> dict:
        meta = record['meta']

        transformed_record = {
            'id': record['uuid'],
            'name': record['name'],
            'inactive': record['status'] == 'BLOCKED',
            'historical': record['status'] == 'HISTORICAL',
            'archived': record['status'] == 'ARCHIVED',
            'accessible_company_ids': meta['accessibleCompanyUuids'],
            'corporate_company': meta['corporateCompanyUuid'],
        }

        if transformed_record['id'] == self.master_company_uuid:
            transformed_record['corporate_company'] = MASTER

        if meta.get('parentUuids'):
            transformed_record['parent_ids'] = meta['parentUuids']

        if 'children' in record:
            transformed_record['children'] = [self.__transform_record(record=child) for child in record['children']]

        return transformed_record            
    
    def reduce_attributes(self, response: dict):
        if isinstance(response['data'], list):
            return [record['attributes'] for record in response['data']]

        return response['data']['attributes']    
    
